DROP TABLE IF EXISTS `qz_biquan_dat`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `qz_biquan_dat` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `buytime` int(11) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `pay` int(11) NOT NULL DEFAULT '0' COMMENT '下注金额',
  `peifu` decimal(10,2) NOT NULL DEFAULT '0.00',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `createtime` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `buyDirection` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '目标涨跌',
  `mode` int(2) unsigned NOT NULL DEFAULT '0' COMMENT '模式',
  `unionid` varchar(200) NOT NULL DEFAULT '0' COMMENT '庄家点数',
  `now` varchar(100) NOT NULL COMMENT '当前指数',
  `result` varchar(100) NOT NULL COMMENT '结果指数',
  `ifkill` tinyint(1) NOT NULL DEFAULT '0' COMMENT '点杀',
  `orderid` varchar(200) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COMMENT='每一局押注';
/*!40101 SET character_set_client = @saved_cs_client */;

