DROP TABLE IF EXISTS `qz_user_count`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `qz_user_count` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `wup` int(11) NOT NULL DEFAULT '0' COMMENT '客服上分',
  `wdown` int(11) NOT NULL DEFAULT '0' COMMENT '客服下分',
  `allin` int(11) NOT NULL DEFAULT '0' COMMENT '所有入款',
  `xallin` int(11) NOT NULL DEFAULT '0' COMMENT '虚拟入款',
  `allout` int(11) NOT NULL DEFAULT '0' COMMENT '所有赔付',
  `srpay` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '个人支付金额',
  `kfdown` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '客服下分',
  `kfup` int(11) NOT NULL DEFAULT '0' COMMENT '客服上分',
  `result` int(11) NOT NULL DEFAULT '0' COMMENT '结果',
  `paytime` int(11) NOT NULL DEFAULT '0' COMMENT '支付次数',
  `peitime` int(11) NOT NULL DEFAULT '0' COMMENT '提现次数',
  `onlinetixiantime` tinyint(4) NOT NULL DEFAULT '0' COMMENT '在线提现',
  `award` int(11) NOT NULL DEFAULT '0' COMMENT '奖励',
  `awardok` int(11) NOT NULL DEFAULT '0' COMMENT '已结算佣金',
  `onecount` int(11) NOT NULL DEFAULT '0' COMMENT '一级奖励',
  `twocount` int(11) NOT NULL DEFAULT '0' COMMENT '二级奖励',
  `thrcount` int(11) NOT NULL DEFAULT '0' COMMENT '三级奖励',
  `forcount` int(11) NOT NULL DEFAULT '0' COMMENT '四级奖励',
  `fivcount` int(11) NOT NULL DEFAULT '0' COMMENT '五级奖励',
  `sixcount` int(11) NOT NULL DEFAULT '0',
  `sevcount` int(11) NOT NULL DEFAULT '0',
  `eigcount` int(11) NOT NULL DEFAULT '0',
  `nigcount` int(11) NOT NULL DEFAULT '0',
  `tencount` int(11) NOT NULL DEFAULT '0',
  `elecount` int(11) NOT NULL DEFAULT '0',
  `twecount` int(11) NOT NULL DEFAULT '0',
  `thicount` int(11) NOT NULL DEFAULT '0',
  `foucount` int(11) NOT NULL DEFAULT '0',
  `fifcount` int(11) NOT NULL DEFAULT '0',
  `awardtime` int(10) NOT NULL DEFAULT '0' COMMENT '最后结算时间',
  `createtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=537 DEFAULT CHARSET=utf8;
